import React from "react";
import { Grid, Typography } from "@mui/material";
import Navbar from "./components/Navbar";

import "./about.css";
import Slideshow from "./Slideshow";

export default function About() {
  return (
    <div>
      <Navbar typeOfBar="mainNav" />
      <Grid
        container
        direction="column"
      >
        <Grid item>
          <div className="about_head">
            <Typography variant="h2">ABOUT US</Typography>
          </div>
        </Grid>
        <Grid
          item
          xs={4}

        >
          <Typography
            variant="h6"
            sx={{
              background: "#308335",
              opacity: "80%",
              padding: "2em",
              color: "#ffffff",
            }}
          >
            For farms with low mechanization, crop harvesting is the most
            labor-intensive activity of the season. Harvesting is not limited to
            just fields but includes orchards, vineyards, and plantations too.
            Name-A-Crop makes it easier for farmers to identify crops. this
            process can be implemented at various parts of the farming value
            chain. Most farmers are using the sysytem during the packaging
            process in order to identify the type of crop that is being
            packeged. this helos farmers reduce labour intensive jobs and focus
            on higher-priority duties.
          </Typography>
        </Grid>

        <Grid
          item
          xs={6}
          sx={{
            padding: "0.5em",
            // border: "1px solid orange",
          }}
        >
          <Slideshow />
        </Grid>
      </Grid>
    </div>
  );
}
